//import logo from './logo.svg';
import "./App.css";
import Login from "./Login";
import { BrowserRouter, Route } from "react-router-dom";
import Register from "./Register";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Route path="/register" component={Register} />
        <Route path="/login" component={Login} />
      </BrowserRouter>
      <Register />
    </div>
  );
}

export default App;
